import { Button } from '@mui/joy';
import './App.css';
import Login from './Views/Login/Login';

function App() {
  return (
    <>
      <Button
        variant="solid"
        color="primary"
        onClick={() => console.log(process.env.API_ROUTE)}
      >
        API Healt check
      </Button>
      <Login />
    </>
  );
}

export default App;
